import React, { useState, useEffect } from "react";
import QRCode from "react-qr-code";

function Userqr() {
  const [userData, setUserData] = useState(null);

  const generateQRCode = async () => {
    try {
      const response = await fetch(`/user/profile`, {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
          Authorization: localStorage.getItem("usersdatatoken"),
        },
      });
      const data = await response.json();
      setUserData(data);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    generateQRCode();
  }, []);

  return (
    <>
      <div className="bg-gradient-to-b from-gray-900 to-gray-600 bg-gradient-to-r p-1 rounded-md">
        <h1 className="text-2xl font-bold mb-1 bg-gradient-to-r from-cyan-500 to-blue-500 bg-clip-text text-transparent text-center pl-1 rounded-lg">
          Your QR Code
        </h1>
        <div className=" ">
          {userData && <QRCode value={JSON.stringify(userData)} size={222} />}
        </div>
      </div>
    </>
  );
}

export default Userqr;
